import React from 'react';
import './Footer.css'; 

const Footer = () => {
  return (
    <footer className="footer">
      <div className="footer-content">
        <p><span className="footer-content-span">© {new Date().getFullYear()}</span> <br/> Maison Nordic.</p>
        <p className="footer-content-span">Todos os direitos reservados.</p>
        <p className="footer-content-span">Endereço: Rua Exemplo, 123 - Cidade, Estado</p>
        <p className="footer-content-span">Telefone: (+351) 25734-5678</p>
      </div>
    </footer>
  );
};

export default Footer;
